import logo from './logo.svg';
import './App.css';

function App() {
    const colors = ["red","blue","green","black"]
    const wanted = colors.map(
        (x) =>{
            <h3>{x}</h3>
        }

    )
  return (
    <div className="App">
        {wanted}
    </div>
  );
}



export default App;
